import { httpService } from "./http.service";

const Route = "auth";

async function login(user) {
  try {
    const loggedUser = await httpService.post(`${Route}/login`, user);
    return loggedUser;
  } catch (error) {
    console.log("error while login: ", error);
  }
}

export const authService = {
  login,
};
